import React from 'react';
import NavMenu from './components/NavMenu'
import SearchForm from './components/SearchForm'
import DumbQuote from './components/DumbQuote'
import './App.css';

function App() {
  return (
    <div className="App">
     <h1>This is the homepage</h1>
     <NavMenu />
     <SearchForm />
     <DumbQuote />
    </div>
  );
}

export default App;
